import React from 'react';
import { Collapse, Button } from 'react-bootstrap';
import Fields from './fieldset.jsx';

const Workspace = ({exploreOpen}) => {

    const datafield  =[{"box1":<input type="text" value="" />,
                         box2:  <input type="text" value="" />},
                         {"box1":<input type="text" value="" />,
                         box2:  <input type="text" value="" />}];
 const equal = "="
 const multiple = "X"
 const plus = "+"


    return ( 
        <div>
                <Collapse in={exploreOpen}>
                   <div id="example-collapse-text">
                        {datafield.map((d, idx)=>{
                                return (<Fields key={idx}>{d.box1}{equal}{d.box2}</Fields>)
                            })}
                   </div>
          </Collapse>
        </div>
     )
   };
   
   export default Workspace;
